import React from 'react';
import {Row, Col, Form} from 'react-bootstrap';
export const Addticket_form =() =>{
    return(
       <div className='Jubotron'>
            <Row>
                <Col>
                    <Form>
                        <Form.Group>
                            <Form.Label>Subjects</Form.Label>
                            <Form.Control type=''/>
                        </Form.Group>
                    </Form>
                </Col>
            </Row>
       </div>
    )
}
